/* Calculate True Range */
function calculateTR() {
    let hl = candle.max - candle.min

    if (variable.prevClose === 0) { return hl } // Return High-Low when previous Close is 0

    let hcp = Math.abs(candle.max - variable.prevClose)
    let lcp = Math.abs(candle.min - variable.prevClose)

    return Math.max(hl, hcp, lcp)
}

/* Calculate Average True Range - Smoothing Function SMA */
function calculateATR(length) {
    /* We check we have enough values to make the calculation */
    if (variable.lastTR.length < length) { return 0 } // If not,  define the value as zero.

    let sum = 0 // Initialise sum variable. 
    for (let i = variable.lastTR.length - length; i < variable.lastTR.length; i++) { // Iterate through the last periods
        sum = sum + variable.lastTR[i]
    }

    let atr = sum / length
    return atr
}

function calculateEMA(periods, price, previousEMA) {
    let k = 2 / (1 + periods)
    return price * k + previousEMA * (1-k)
}

